package da.DongbinNa;

import java.util.Stack;

public class StackSample {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

	Stack st = new Stack<Integer>();
	
	
	st.push(5);
	st.push(2);
	st.push(3);
	st.push(7);
	st.pop();
	st.push(1);
	st.push(4);
	st.pop();
	
	System.out.println(st);
	
	
	
	}

	
	
}
